    def mousePressEvent(self, event):
        # Start dragging when the mouse button is pressed on the titlebar
        if event.button() == QtCore.Qt.MouseButton.LeftButton:
            self.is_dragging = True
            self.mouse_pos = event.globalPosition().toPoint()  # Get the global position of the mouse
            event.accept()

    def mouseMoveEvent(self, event):
        # Drag the window when the mouse is moved
        if self.is_dragging:
            delta = event.globalPosition().toPoint() - self.mouse_pos  # Calculate the movement of the mouse
            MainWindow.move(MainWindow.pos() + delta)  # Move the window by the delta
            self.mouse_pos = event.globalPosition().toPoint()  # Update the position of the mouse
            event.accept()

    def mouseReleaseEvent(self, event):
        # Stop dragging when the mouse button is released
        if event.button() == QtCore.Qt.MouseButton.LeftButton:
            self.is_dragging = False
            event.accept()


